import React from 'react';
import './index.css';
import Navbar from "./components/Navbar"

function App() {
  const [currentWeather, setCurrentWeather] = React.useState([])
  let apiKey = "7ab98e97faa64c4d8b4104902222202"
  let lat = "34.51"
  let lon = "-105.87"
  let location = "Arlington"

  React.useEffect(() =>{
    fetch(`https://api.weatherapi.com/v1/current.json?key=${apiKey}&q=${location}&aqi=no`)
    .then(res => res.json())
    .then(data => setCurrentWeather(data))
  }, [])

  React.useEffect(() =>{
    fetch(`https://api.weatherapi.com/v1/search.json?key=${apiKey}&q=${location}&aqi=no`)
    .then(res => res.json())
    .then(data => console.log(data))
  }, [])

  console.log(currentWeather)

  return (
    <div className="App">
      <Navbar />
    </div>
  );
}

export default App;
